import React from 'react';
import maxPicture from '../images/max.jpg'

export default function Home() {
    const pictureStyle = {
        display: 'block',
        'margin-left': 'auto',
        'margin-right': 'auto',
        marginTop: '10px',
        height: 'auto',
        width: '40%',
        border: '5px solid #e4ddca',
        borderImage: 'linear-gradient(to bottom, #e4ddca, transparent) 1 49%'
      };

    const textStyle =  {
        color: 'white',
        'text-align': 'center'
    }

// Above is CSS code

    return (
        <>
            <h3 style={textStyle}>
                Who is that handsome fella? 
            </h3>
            <img src={maxPicture} className="App-logo" alt="logo" style={pictureStyle} />
        </>
    )
}
